    var latestSignal;
	var triggered = null;
    var currentTriggered = System.getChannelValue(`SENSAHUB/${User.accountid}/YABBY/${serNo.toUpperCase()}/STATE`);
    var triggeredTime = null;
    var latestBattery;
    var updateAddress = false;
    var debug = 3;

