		triggered = 0; // Set default to 0
	}

	// Could be updated to get the latest packet in the records and just use that.
	// Would still need to filter through packets for reason codes though.
    for (var p of records) {
        var reason = p.Reason;
        var date = new Date(p.DateUTC);

        var lat;
        var lng;
        var temp;
        var signal;
        var battery;

        var fields = p.Fields;
        for (f of fields) {
