/**
 * Response to incoming flow message. eventData object passed in with:
 * eventData.value - incoming data value (string)
 * eventData.startCh - state of channel that initiated the flow and the channel details (Object. Members {channel}, {value})
 * @return {string} return a value to continue the flow or to cancel flow return null
 */
Script.on("flow", function(eventData) {
	// Get the message source device name
	var device = eventData.startCh.channel.instance;
	var subject = "Camera device '" + device + "' has not communicated for more than " + eventData.value;

	// Get trapper associated with the trap
	var dbResult = Database.readRecords("traps","state","trapper", "id='" + device + "'");

	// Do we have a trapper?
	if (Object.keys(JSON.parse(dbResult).data).length > 0) {
		var trapper = JSON.parse(dbResult).data[device];

		// Lookup email address
		var email = "undefined";
		var dirInfo = JSON.parse(Database.readRecords("directory", "users", "email,alias","alias='" + trapper + "'"));
		let trapperUser = Object.keys(dirInfo.data)[0];
		if (Array.isArray(dirInfo.data[trapperUser])) {
			email = dirInfo.data[trapperUser][0];
			if (email === "") {
				System.writeLog("WARNING - Camera '" + device + "' has stopped communicating but there is no email registered for trapper '" + trapper + "' to send alert.");
				//return;
			}
			return JSON.stringify({
				"to": [email, "alert@sensahub.com"],
				"subject": subject,
				"alertMessage": subject,
				"device": device,
				"trapper": trapper,
				"battery": "tempBattery",
				"signalStrength": "tempSignalStrength",
				"statusColor": "red",
			});
			//return JSON.stringify({"to":[email, "alert@sensahub.com"],"subject":subject,"body":"Message from Animal Traps Solutions: Please check the status of " +
			//			   "camera '" + device + "' as it has stopped communicating, It is most likely that it either has no cellular coverage or battery has run flat.<br /><br />If you require any further assistance please contact us at www.animaltrapsolutions.com/contact-us/ (do not reply to this email)"});
		} else {
			System.writeLog("WARNING - Device heartbeat timed out for device '" + device + "' but can't lookup email address for user '" + trapper + "', can't send email for subject: " + subject);
		}
	} else {
		System.writeLog("INFO - Device heartbeat timed out but no user associated with device '" + device + "', so can't send warning email. Check device signal strength and/or battery.");		
	}
});

