	if (eventData.usrmeta != "DELETE") return null;

	var deviceInfo = JSON.parse(eventData.value).newDev.name;

	// Delete from traps state database.
	if (Database.deleteRecord("traps", "state", "id", "" + deviceInfo) != 0) {
		console.log(`Removed device '${deviceInfo}' from state table for Traps application`);
	} else {
		console.log(`Unable to remove device '${deviceInfo}' from state table for Traps application`); 
	}

	return null;
});
